INSERT INTO `att_client` VALUES (9, '水利信息化平台', '0', '411d6de6694941a2aa094bb2092b45d0', NULL, NULL, NULL, '/profile/2025/02/28/67c1889ee4b0c0f1d852a4bf.png', '水利信息化平台是指利用现代信息技术，如物联网、大数据、云计算、人工智能等，对水利行业的各类数据进行采集、传输、处理和应用，以提高水利管理效率和服务水平的综合性平台。以下是水利信息化平台的主要功能和应用场景水利信息化平台是指利用现代信息技术，如物联网、大数据、云计算、人工智能等，对水利行业的各类数据进行采集、传输、处理和应用，以提高水利管理效率和服务水平的综合性平台。以下是水利信息化平台的主要功能和应用场景', '1', '1', '0', '超级管理员', 1, '2025-02-21 11:39:52', '孟繁明', 731, '2025-03-04 16:28:23', NULL);
