    `STATUS` VARCHAR(1) NOT NULL COMMENT '状态;0下线1上线',
    `RULE_DESCRIPTION` VARCHAR(512) COMMENT '规则描述',
    `ERR_DESCRIPTION` VARCHAR(512) COMMENT '错误描述',
    `SUGGESTION` VARCHAR(512) COMMENT '修复建议',
    `WHERE_CLAUSE` VARCHAR(512) COMMENT 'where条件',
    `OBJ_ID` BIGINT NOT NULL COMMENT '评测对象ID',
    `OBJ_NAME` VARCHAR(128) NOT NULL COMMENT '稽查对象名称',
    `TABLE_NAME` VARCHAR(256) NOT NULL COMMENT '表名称',
    `EVA_COLUMN` VARCHAR(256) NOT NULL COMMENT '检查字段，多个时逗号隔开',
    `RULE` JSON COMMENT '不同规则的自定义,JSON形式',
